Typescript throws compilation error in Mongoose pre hook (Expected 1 arguments, but got 0)<p>I am looking at example code which is placed inside the <code>users.ts</code> file, inside a User model.</p>
<pre><code>userSchema.pre('save', async function(done) {
  if (this.isModified('password')) {
    const hashed = await Password.toHash(this.get('password'));
    this.set('password', hashed);
  }
  done();
});
</code></pre>
<p>However I get a compilation error when I try to build it:</p>
<pre><code>src/models/user.ts(44,3): error TS2554: Expected 1 arguments, but got 0.
</code></pre>
<p>The error thrown looks to be the error with <code>done()</code>, as if I comment it out or change it to <code>done(null)</code> it goes through fine. However I'm not sure why this is happening as typescript states the following format for <code>done()</code>:</p>
<pre><code>(parameter) done: mongoose.HookNextFunction
(error?: mongoose.Error | undefined) =&gt; any
</code></pre>
<p>it should be able to accept an undefined value / empty inside <code>done()</code>, should it not?</p>
<p>Also changing</p>
<pre><code>async function(done) ===&gt; async function(done: any)
</code></pre>
<p>also resolves the issue.</p>
<p>The problem I am trying to resolve is why this is occurring as I have pulled the exact code from the example and have tried to run it, same typescript versions and type files.</p>
<pre><code>&quot;typescript&quot;: &quot;^3.8.3&quot;
&quot;mongoose&quot;: &quot;^5.9.7&quot;,
&quot;@types/mongoose&quot;: &quot;^5.7.8&quot;,
</code></pre>
<p>However for me it does not work, and I can't seem to understand why I have to put <code>: any</code> inside the parameter brackets to get it to work.</p>

