MongoDB aggregate reduce mergeObjects field name from value<p>I have an array in a Mongo document that has a number of properties.  I want to produce a document that has a single object that represents the array.</p>
<pre><code>{
  scores_array: [
    { name: &quot;One&quot;, score: 40, key: &quot;abc&quot; },
    { name: &quot;Two&quot;, score: 50, key: &quot;def&quot; },
    { name: &quot;Three&quot;, score: 40, key: &quot;abc&quot; },
    { name: &quot;Four&quot;, score: 40, key: &quot;ghi&quot; },
  }
}
</code></pre>
<p>What I want is to be able to query for documents that have a particular value for two of the properties in the array, for example, <code>{ name: &quot;One&quot;, score: 40 }</code>.</p>
<p>I can use <code>$in</code> to find documents that have the matching key or value, and I could redact them to filter them out but I need to reference them again later in the same pipeline, so I'm trying to find a way to filter without removing anything from the documents.</p>
<p>My plan is to use <code>$reduce</code> to produce a new property that looks like this:</p>
<pre><code>scores_summary: {
  One: 40,
  Two: 50,
  Three: 40,
  Four: 40,
}
</code></pre>
<p>I'm having trouble getting the <code>$reduce</code> syntax right.  Here's what I've got:</p>
<pre><code>db.test.aggregate([
  {
     $match: {
       scores_array: {$exists: true}
     }
  },
  {
    $project: {
      scores_summary: { 
        $reduce: {
          input: &quot;$scores_array&quot;, 
          initialValue: {}, 
          &quot;in&quot;: {
            &quot;$mergeObjects&quot;: [
              &quot;$$value&quot;, 
              {
                &quot;$$this.name&quot;:&quot;$$this.score&quot;
              }
            ]
          }
        }
      }
    }
  },
]);
</code></pre>
